    false,nt"url": null,nt"notes": "NCEI Accession 0144249 includes Surface
    underway data collected from MIRAI in the Coral Sea, North Pacific Ocean, Philippine
    Sea, Solomon Sea and South Pacific Ocean from 2009-04-10 to 2009-07-03. These data
    include AIR TEMPERATURE, BAROMETRIC PRESSURE, Partial pressure (or fugacity) of
    carbon dioxide - atmosphere, Partial pressure (or fugacity) of carbon dioxide -
    water, SALINITY, SEA SURFACE TEMPERATURE, WIND DIRECTION and WIND SPEED. The instruments
    used to collect these data include Carbon dioxide (CO2) gas analyzer and Shower
    head chamber equilibrator for autonomous carbon dioxide (CO2) measurement.nnThese
    data were collected by Akihiko Murata of Japan Agency for Marine-Earth Science and
    Technology (JAMSTEC) as part of the Underway_P21_2009 data set. CDIAC associated
    the following cruise ID(s) with this data set: 49NZ20090410 and 49NZ20090521nnThe
    International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
    out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
    to quantify changes in storage and transport of heat, fresh water, carbon dioxide
    (CO2), and related parameters.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
